import React from "react";
import { Link } from "react-router-dom";
import Carasouel from "./Carsouel";
function Movie(props){

  return(
    <>
    <Carasouel />
    <Link className="movie-card" to={`/${props.title}`}>
      <img src={props.poster} alt={props.title + ' Flag'} width="250" height="250"/>
      <div className="card-text">
        <h3 className="card-title">{props.title}</h3>
       
        
        <p>
         {props.genre}
        </p>
      </div>
    </Link>
    

    </>
  )
}

export default Movie;
